import React from 'react'
/*import NavBar from './Components/NavBar';
import Featured from './Components/Featured';
import Header from './Components/Header';
import Trending from './Components/Trending';
import Throwback from './Components/Throwback';*/
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'
import NavBar from './Components/NavBar';
import Home from './Components/Home'
import Sample from './Components/Sample'
import Discover from './Components/Discover';
import AboutUs from './Components/AboutUs';
import LogIn from './Components/LogIn';

function App() {
  return (
    <div className="bg-[#1A1A1A]">
      <BrowserRouter>
      <header>
      <nav className="absolute flex -space-x-[-505px] text-white pl-20 pt-16">
        <p className="text-2xl font-['Outfit'] font-semibold">AnimeBinge</p>
        <div className="flex gap-16 items-center">
            <Link to="home"><button className="text-base">Home</button></Link>
            <Link to="discover"><button className="text-base">Discover</button></Link>
            <Link to="aboutus"><button className="text-base">About Us</button></Link>
            <div className="flex gap-5 items-center">
            <button className="rounded-md bg-transparent border-[1px] border-white text-base px-8 py-3">Sign Up</button>
            <Link to="login"><button className="rounded-md bg-[#106580] border-[1px] border-[#106580] text-base px-8 py-3">Log In</button></Link>
            </div>
        </div>
        </nav>
        </header>
      <Routes>
        <Route path="/home" element={<Home />} />
        <Route path="/discover" element={<Discover />} />
        <Route path="/aboutus" element={<AboutUs />} />
        <Route path="/login" element={<LogIn />} />
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
